import { Card } from "../../common/card"; 

export const HomePage = () => {
  return (
    <div>
      <h1>Welcome to the Home Page</h1>
      <Card
        theme={{
          borderColor: "#eee",
          background: "#fff",
          color: "#333",
        }}
        content={<p>This is the home page content.</p>}
      />
    </div>
  );
};
